import React from 'react';
import ReactDOM from 'react-dom';
import Heading from '.Heading/';

ReactDOM.render (
    <>
      <Heading/>
      <p>Some dummy Content here</p>
      <ul>
        <li>list1</li>
        <li>list2</li>
        <li>list3</li>
        <li>list4</li>
      </ul>
    </>, document.getElementById('root')
);
